import "./Header.css";

import MovieCreationIcon from '@material-ui/icons/MovieCreation';
const Header =() => {
    return(
        <>
           <span className='header'><MovieCreationIcon></MovieCreationIcon>Entertainment Hub<MovieCreationIcon/></span>
           <ul>
               <li>
                   <a href='/'>Trending</a>
               </li>
               <li>
                   <a href='/Movies'>Movies</a>
               </li>
               <li>
                   <a href='/Series'>Series</a>
               </li>
               <li>
                   <a href='/Search'>Search</a>
               </li>
           </ul>
        </>
    )   
};
export default Header;
